import PropTypes from 'prop-types';
import Header from './Header';

Layout.propTypes = {
  children: PropTypes.node || PropTypes.string
};

function Layout(props) {
  return (
    <div >
      <Header />
      {props.children}
    </div >
  );
}

export default Layout;
